import React from 'react';
import '../style/index.css';
import Navigation from '../components/navigation'
import projetPreview from '../components/projetPreview'

const Project = () => {
    return (
        <main className='accueil'>
            <Navigation />
            <projetPreview />
        </main>
    );
};
export default Project;
